    $(function () {
        var itemPreviewSlider = $('.item-preview-slider');
        var itemOriginalSlider = $('.item-original-slider');
        var itemPreviewPopSlider = $('.item-preview-pop-slider ');
        var itemOriginaPoplSlider = $('.item-original-pop-slider');
        itemPreviewPopSlider.owlCarousel({
            items: 5,
            nav: true,
            dots: false,
            loop: false,
            smartSpeed: 500,
            margin: 10,
            mouseDrag: true,
            touchDrag: true,
            navText: [
                '<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none"><path d="M12 1.5L12 23" stroke="#333333" stroke-linecap="round" stroke-linejoin="round"/><path d="M21 10L13.4142 2.41421C12.7475 1.74755 12.4142 1.41421 12 1.41421C11.5858 1.41421 11.2525 1.74755 10.5858 2.41421L3 10" stroke="#333333" stroke-linecap="round" stroke-linejoin="round"/></svg>',
                '<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none"><path d="M12 22.5L12 1" stroke="#333333" stroke-linecap="round" stroke-linejoin="round"/><path d="M21 14L13.4142 21.5858C12.7475 22.2525 12.4142 22.5858 12 22.5858C11.5858 22.5858 11.2525 22.2525 10.5858 21.5858L3 14" stroke="#333333" stroke-linecap="round" stroke-linejoin="round"/></svg>'
            ],
            responsive: {
                0: {
                    items: 3
                },
                768: {
                    items: 4
                },
                1560: {
                    items: 6
                }
            }
        });

        itemOriginaPoplSlider.owlCarousel({
            items: 1,
            nav: true,
            dots: false,
            loop: false,
            margin: 0,
            navText: [
                '<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none"><path d="M12 1.5L12 23" stroke="#333333" stroke-linecap="round" stroke-linejoin="round"/><path d="M21 10L13.4142 2.41421C12.7475 1.74755 12.4142 1.41421 12 1.41421C11.5858 1.41421 11.2525 1.74755 10.5858 2.41421L3 10" stroke="#333333" stroke-linecap="round" stroke-linejoin="round"/></svg>',
                '<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none"><path d="M12 22.5L12 1" stroke="#333333" stroke-linecap="round" stroke-linejoin="round"/><path d="M21 14L13.4142 21.5858C12.7475 22.2525 12.4142 22.5858 12 22.5858C11.5858 22.5858 11.2525 22.2525 10.5858 21.5858L3 14" stroke="#333333" stroke-linecap="round" stroke-linejoin="round"/></svg>'
            ],
            responsive: {
                1024: {
                    dots: false
                },
            },
            onChanged: itemImagePopCallback
        });
        var itemPreviewPopItem = $(' .owl-item', itemPreviewPopSlider);

        function itemImagePopCallback(e) {
            if (!itemPreviewPopItem) itemPreviewPopItem = $(' .owl-item', itemPreviewPopSlider);
            var index = e.item.index;
            itemPreviewPopItem.removeClass('current').eq(index).addClass('current');
            itemPreviewPopSlider.trigger("to.owl.carousel", [index, 300, true]);
        }

        itemPreviewPopItem.click(function () {
            console.log($(this).index())
            var index = $(this).index();
            //itemOriginaPoplSlider.trigger("to.owl.carousel", [index, 300, true]);
        });
        $(document).on('touchstart click', '.item-preview-pop-slider .owl-item', function (event) {
            console.log(event)
            console.log($(this).index())
            var index = $(this).index();
            itemOriginaPoplSlider.trigger("to.owl.carousel", [index, 300, true]);
        });
        itemPreviewSlider.owlCarousel({
            items: 5,
            nav: true,
            dots: false,
            loop: false,
            smartSpeed: 500,
            margin: 10,
            mouseDrag: false,
            touchDrag: false,
            navText: [
                '<svg><use xlink:href="#icon-arrow-prev"></use></svg>',
                '<svg><use xlink:href="#icon-arrow-next"></use></svg>'
            ],
            responsive: {
                0: {
                    items: 3
                },
                768: {
                    items: 4
                },
                1560: {
                    items: 5
                }
            }
        });

        itemOriginalSlider.owlCarousel({
            items: 1,
            nav: false,
            dots: false,
            loop: false,
            margin: 0,
            responsive: {
                1024: {
                    dots: false
                },
            },
            onChanged: itemImageCallback
        });
        var itemPreviewItem = $('.owl-item', itemPreviewSlider);

        function itemImageCallback(e) {
            if (!itemPreviewItem) itemPreviewItem = $('.owl-item', itemPreviewSlider);
            var index = e.item.index;
            itemPreviewItem.removeClass('current').eq(index).addClass('current');
            itemPreviewSlider.trigger("to.owl.carousel", [index, 300, true]);
            itemPreviewPopSlider.trigger("to.owl.carousel", [index, 300, true]);
        }

        itemPreviewItem.click(function () {
            var index = $(this).index();
            itemOriginalSlider.trigger("to.owl.carousel", [index, 300, true]);
            itemOriginaPoplSlider.trigger("to.owl.carousel", [index, 300, true]);
        });
    });

