function fixedHeaderInit(header, top) {
	if (!header.length) return;

	var $window = $(window);

	$window.scroll(function () {
		var scrollTop = $window.scrollTop();

		if (scrollTop >= top) {
			if (!header.hasClass('extrahead_show'))
				header.addClass('extrahead_show');
		} else {
			if (header.hasClass('extrahead_show')) {
				header.removeClass('extrahead_show');
			}
		}

	}).scroll();
}

