document.addEventListener("click", (e) => {
    const isIOS = /iPad|iPhone|iPod/.test(navigator.userAgent);

    const handler = (e) => {
        const target = e.target;

        if (target.classList.contains("copy-text") || target.closest(".copy-text")) {
            e.stopImmediatePropagation();
            e.preventDefault();

            const text = target.textContent || target.querySelector('span').textContent;
            copyClipboard(text, target);
        }
    };

    if (isIOS) {
        document.addEventListener("touchend", handler);
    } else {
        document.addEventListener("click", handler);
    }

})

const copyClipboard = (text, target) => {
    navigator.clipboard.writeText(text);
    createPopover(target);
}

const createPopover = (target) => {
    const existingPopover = target.querySelector('.copy-text-popover');
    if (existingPopover) {
        existingPopover.remove();
    }

    const div = document.createElement("div");
    div.className = 'copy-text-popover';
    div.innerHTML = 'Скопировано';

    target.closest('.copy-text').appendChild(div);

    setTimeout(() => {
        div.remove();
    }, 1500);
};
