function validate_num(evt) {
    var theEvent = evt || window.event;
    var key = theEvent.keyCode || theEvent.which;
    key = String.fromCharCode( key );
    var regex = /[0-9\s\+\-]|\./;
    if( !regex.test(key) ) {
        theEvent.returnValue = false;
        if(theEvent.preventDefault) theEvent.preventDefault();
    }
}
function validate_lat_symbols(evt) {
    var theEvent = evt || window.event;
    var key = theEvent.keyCode || theEvent.which;
    key = String.fromCharCode(key);
    var regex = /^[a-zA-Z0-9\s@._]+$/; // Регулярное выражение для латиницы, цифр, пробелов и символов @, ., _
    if (!regex.test(key)) {
        theEvent.returnValue = false;
        if (theEvent.preventDefault) theEvent.preventDefault();
    }
}
function validate_lat_rus(evt) {
    var theEvent = evt || window.event;
    var key = theEvent.keyCode || theEvent.which;
    key = String.fromCharCode(key);
    var regex = /^[a-zA-Zа-яА-ЯёЁ\s]+$/; // Регулярное выражение для латиницы, русских букв и пробелов
    if (!regex.test(key)) {
        theEvent.returnValue = false;
        if (theEvent.preventDefault) theEvent.preventDefault();
    }
}
$('input[name="form_text_30"]').keypress(function (){
    validate_num(event);
})
$('input[name="form_text_30"]').on('paste', function(event) {
    validate_num(event);
});
$('input[name="form_email_19"]').keypress(function (){
    validate_lat_symbols(event);
})
$('input[name="form_email_19"]').on('paste', function(event) {
    validate_lat_symbols(event);
});
$('input[name="form_text_16"]').keypress(function (){
    validate_lat_rus(event);
})
$('input[name="form_text_16"]').on('paste', function(event) {
    validate_lat_rus(event);
});

const isHoverSupported = () => window.matchMedia('(hover: hover)').matches;

const closeAllOptInfo = (excludeElement = null) => {
    document.querySelectorAll('.price-opt__info.active').forEach(info => {
        if (info !== excludeElement) {
            info.classList.remove('active');
        }
    });
};

const handleDocumentClick = (event) => {
    const clickedElement = event.target;
    const isToggle = clickedElement.closest('.opt-info-toggle');
    const isInfo = clickedElement.closest('.price-opt__info');

    if (!isToggle && !isInfo) {
        closeAllOptInfo();
    }
};

const toggleOptInfo = (event) => {
    event.stopPropagation();
    const toggleElement = event.currentTarget;

    const infoElement = toggleElement.nextElementSibling?.classList.contains('price-opt__info')
        ? toggleElement.nextElementSibling
        : toggleElement.closest('.price-opt__info');

    if (infoElement) {
        if (!infoElement.classList.contains('active')) {
            closeAllOptInfo(infoElement);
        }
        infoElement.classList.toggle('active');
    }
};

if (!isHoverSupported()) {
    document.querySelectorAll('.opt-info-toggle').forEach(toggle => {
        toggle.addEventListener('click', toggleOptInfo);
    });

    document.addEventListener('click', handleDocumentClick);
}

